import React from 'react';
import ReactDOM from 'react-dom';


ReactDOM.render(
    <ul>
        <li>1</li>;
        <li>2</li>;
        <li>3</li>;
        <li>4</li>;
        <li>5</li>;
    </ul>

    , document.getElementById('root'));
